pragma solidity >=0.7.0 <0.9.0;

contract MathCardio {    
  uint public x = 2;
  uint public y = 3;

  function summa() public {
    uint sum = x + y;
    uint power = sum ** x;
    uint modulo = power % y;
  }
}

